// Scene.jsx
import { Canvas } from "@react-three/fiber";
import { Photos } from "./Photos";
import image from "./test.png";

export default function Scene() {
  return (
    <Canvas style={{ width: "100vw", height: "100vh" }}>
      <color attach="background" args={["black"]} />
      <Photos image={image} />
    </Canvas>
  );
}
